import React from 'react';

const EventsPage = () => {
  const calendarSrc = `https://calendar.google.com/calendar/embed?src=primary&ctz=Asia/Kolkata`; // Use appropriate timezone

  return (
    <div>
      <h1>Your Google Calendar</h1>
      <iframe
        src={calendarSrc}
        style={{ border: '0' }}
        width="800"
        height="600"
        frameBorder="0"
        scrolling="no"
        title="Google Calendar"
      ></iframe>
    </div>
  );
};

export default EventsPage;

